demo.repl.help:
Commandes disponibles :
  @show              ─ afficher le résumé de la dernière carte adaptative
  @json              ─ afficher la valeur JSON brute reçue du flux
  @back              ─ revenir à la carte/aux entrées bloquées précédentes
  @input <k>=<v>     ─ définir ou remplacer une entrée
  @click <action_id> ─ soumettre la carte avec l’action fournie
  @help              ─ afficher cette aide
  @quit              ─ quitter le REPL
